function OnAfterUpdateBasket(){
  function UpdateBasketChangeTimer(_input){
    if(submit_timeout_id){
      clearTimeout(submit_timeout_id);
    }
    submit_timeout_id = setTimeout(function(){
      var block = _input.closest("tr");
      var product_id = block.data("product_id");
      var quantity = _input.val();
      ChangeBasketProductQuantity(product_id, quantity);
    }, 1000);
  }
  var submit_timeout_id = 0;
  var basket_form = $(".form_basket");

  $('.qty-block', basket_form).each(function(){
    var block = $(this);
    var minus = $('.minus', block);
    var plus = $('.plus', block);
    var f = $('input', block);
    var ratio = f.data('ratio');

    minus.on("click", function(){
      var val = parseInt(f.val()) - ratio;
      if(val < ratio){
        val = ratio;
      }
      f.val(val).change();
      return false;
    });

    plus.on("click", function(){
      var val = (parseInt(f.val()) || 0) + ratio;
      f.val(val).change();
      return false;
    });
  });

  $(".quantity", basket_form).on("change", function(){
    UpdateBasketChangeTimer($(this));
    return false;
  });
  $(".quantity", basket_form).on("keyup", function(){
    $(this).change();
    return false;
  });

  $(".remove-link", basket_form).on("click", function(){
    var block = $(this).closest("tr");
    var id = block.data("id");
    var product_id = block.data("product_id");
    DeleteBasketProduct(id, product_id);
    return false;
  });

  $(".reset", basket_form).on("click", function(){
    ClearBasket();
    return false;
  });
  
  $(".add_coupon", basket_form).on("click", function(){
    UpdateBasket();
    return false;
  });
  
  $(".delete_coupon", basket_form).on("click", function(){
    DeleteCoupon();
    return false;
  });
}

